import { defineMessages } from 'react-intl';

export const scope = 'app.containers.PartInfo';

export default defineMessages({
  partInfo: {
    id: `${scope}.partInfo`,
    defaultMessage: 'Part Info',
  },
  edit: {
    id: `${scope}.edit`,
    defaultMessage: 'Edit',
  },
  somethingwentwrong: {
    id: `${scope}.somethingwentwrong`,
    defaultMessage: 'Something went wrong!',
  },

});
